Explicación: Este soneto es un poema satírico de Francisco de Quevedo (1580-1645), un reconocido poeta barroco español del siglo XVII. El poema describe irónicamente la casa de una cortesana llamada Chenca, jugando con las ideas de lujuria, pecado y transformación de su vida.
